import React, { useState } from 'react';
import { useEffect } from 'react';
import Sidebar from '../../../../sidebar/Sidebar';
import { Create, DeleteOutlined } from '@mui/icons-material';

const Borrowers = ({ setAuth }) => {
  const [clients, setClients] = useState([]);

  const getClient = async () => {
    try {
      const response = await fetch('http://localhost:8000/clients', {
        method: 'GET',
        headers: { Authorization: localStorage.getItem('token') },
      });

      const parseRes = await response.json();
      // console.log(parseRes);

      setClients(parseRes);
    } catch (error) {
      console.log(error);
    }
  };

  const columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    {
      field: 'username',
      headerName: 'Username',
      width: 130,
    },
    { field: 'email', headerName: 'Email', width: 130 },
    {
      field: 'status',
      headerName: 'Status',
      width: 130,
    },
    {
      field: 'transaction',
      headerName: 'Transaction',
      width: 160,
    },
    {
      field: 'action',
      headerName: 'Action',
      width: 150,
      renderCell: (params) => {
        return (
          <div>
            <Link to={'/user/' + params.row.id}>
              <Create
              // className='userListEdit'
              />
            </Link>
            <DeleteOutlined
              // className='userListDelete'
              onClick={() => handleDelete(params.row.id)}
            />
          </div>
        );
      },
    },
  ];

  useEffect(() => {
    getClient();
  }, []);

  return (
    <div class='text-gray-900 bg-gray-200 flex'>
      <Sidebar />
      {/* Clients */}
      <div className='w-full mx-auto px-8 pt-6 pb-8 mb-4 bg-white shadow-md rounded '>
        <div className='px-4 py-5 sm:px-6 bg-red-500'>
          <h3 className='text-lg font-medium leading-6 text-white'>
            Borrowers
          </h3>
          <p className='mt-1 max-w-2xl text-sm text-white'>
            All clients personal information
          </p>
        </div>
        <table className='table-fixed text-center '>
          <thead>
            <tr>
              <th className='w-1/1 px-1 py-2 text-gray-600'>ID</th>
              <th className='w-1/4 px-1 py-2 text-gray-600'>Full Name</th>
              <th className='w-1/4 px-1 py-2 text-gray-600'>Contact Number</th>
              <th className='w-1/4 px-4 py-2 text-gray-600'>Address</th>
              <th className='w-1/4 px-1 py-2 text-gray-600'>Email</th>
              <th className='w-1/1 px-1 py-2 text-gray-600'>Action</th>
            </tr>
          </thead>
          <tbody>
            {clients.length <= 0 ? (
              <tr className='border px-4 py-2 bg-red-50'>
                <td></td>
                <td></td>
                <td className='px-4 py-2 bg-red-50'>No Client Data</td>
                <td></td>
                <td></td>
              </tr>
            ) : (
              clients.map((client, index) => {
                return (
                  <tr key={index}>
                    <td className='border px-4 py-2 bg-gray-50'>{client.id}</td>
                    <td className='border px-4 py-2 '>
                      {client.firstname + ' ' + client.lastname}{' '}
                    </td>
                    <td className='border px-4 py-2 bg-gray-50'>
                      {client.contactnumber}
                    </td>
                    <td className='border px-4 py-2'>{client.address}</td>
                    <td className='border px-4 py-2 bg-gray-50'>
                      {client.email}
                    </td>
                    <td className='border px-4 py-2'>
                      <button>
                        {' '}
                        <svg
                          fill='currentColor'
                          viewBox='0 0 16 16'
                          height='1em'
                          width='1em'
                        >
                          <path d='M5.5 5.5A.5.5 0 016 6v6a.5.5 0 01-1 0V6a.5.5 0 01.5-.5zm2.5 0a.5.5 0 01.5.5v6a.5.5 0 01-1 0V6a.5.5 0 01.5-.5zm3 .5a.5.5 0 00-1 0v6a.5.5 0 001 0V6z' />
                          <path
                            fillRule='evenodd'
                            d='M14.5 3a1 1 0 01-1 1H13v9a2 2 0 01-2 2H5a2 2 0 01-2-2V4h-.5a1 1 0 01-1-1V2a1 1 0 011-1H6a1 1 0 011-1h2a1 1 0 011 1h3.5a1 1 0 011 1v1zM4.118 4L4 4.059V13a1 1 0 001 1h6a1 1 0 001-1V4.059L11.882 4H4.118zM2.5 3V2h11v1h-11z'
                          />
                        </svg>
                      </button>
                      <button className=''>
                        <svg
                          fill='none'
                          stroke='currentColor'
                          strokeLinecap='round'
                          strokeLinejoin='round'
                          strokeWidth={2}
                          viewBox='0 0 24 24'
                          height='20px'
                          width='1em'
                        >
                          <path d='M11 4H4a2 2 0 00-2 2v14a2 2 0 002 2h14a2 2 0 002-2v-7' />
                          <path d='M18.5 2.5a2.121 2.121 0 013 3L12 15l-4 1 1-4 9.5-9.5z' />
                        </svg>
                      </button>
                    </td>
                  </tr>
                );
              })
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Borrowers;
